INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_subheading`, `field_infoHeroTopText`, `field_infoHeroBottomText`, `field_firstSectionHeader`, `field_firstSectionSubheader`, `field_secondSectionHeader`, `field_secondSectionSubheader`, `field_thirdSectionHeader`, `field_thirdSectionSubheader`, `field_firstSectionBodyLeft`, `field_firstSectionBodyRight`, `field_secondSectionBody`, `field_personnel1Name`, `field_personnel2Name`, `field_personnel3Name`, `field_personnel1Title`, `field_personnel2Title`, `field_personnel3Title`, `field_contactSectionHeader`, `field_contactSectionAddress`, `field_contactSectionPhone1`, `field_contactSectionPhone2`, `field_contactSectionPhone3`, `field_contactSectionEmail`, `field_contactSectionMapLink`, `field_backgroundColor`, `field_urlLink`, `field_shortDescription`, `field_indexHeading`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('47', '105', 'en', 'DIVA! Becomes Famous', 'Vero eos et accusamus et iusto', NULL, 'minus id quod maxime', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>At the 2014 Webby Awards, Patton Oswald said that DIVA! has done for women in the music industry what the 19th amendment did for women 100 years ago. Signissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non.</p>', NULL, '2014-10-03 03:58:26', '2015-02-02 17:04:47', 'f4c25f37-19db-4730-b97e-c564f155c7d6');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_subheading`, `field_infoHeroTopText`, `field_infoHeroBottomText`, `field_firstSectionHeader`, `field_firstSectionSubheader`, `field_secondSectionHeader`, `field_secondSectionSubheader`, `field_thirdSectionHeader`, `field_thirdSectionSubheader`, `field_firstSectionBodyLeft`, `field_firstSectionBodyRight`, `field_secondSectionBody`, `field_personnel1Name`, `field_personnel2Name`, `field_personnel3Name`, `field_personnel1Title`, `field_personnel2Title`, `field_personnel3Title`, `field_contactSectionHeader`, `field_contactSectionAddress`, `field_contactSectionPhone1`, `field_contactSectionPhone2`, `field_contactSectionPhone3`, `field_contactSectionEmail`, `field_contactSectionMapLink`, `field_backgroundColor`, `field_urlLink`, `field_shortDescription`, `field_indexHeading`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('56', '114', 'en', 'How it\'s Made', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<h3>From conception to perfection, we Craft each one of our digital products by hand</h3>\r\n<p style=\"text-align: center;\">\r\n	Some studios have a secret or complex process on how they create great work. Ours is not a secret and its very simple: \r\n	<strong><em>Truth.</em></strong> Here at Happy&nbsp;Lager we believe that every digital product we make speaks to the integrity of our craft. We want to use great products,&nbsp;<strong><em>so we only create great products</em></strong>.\r\n</p>', '2014-10-03 15:43:03', '2014-10-05 03:19:47', '23b143ca-9856-4fc4-9105-b5a94c9a2324');
